import React, { Component } from 'react';
import { Bar } from 'react-chartjs-2';

export default class Prova extends Component {
    constructor() {
        super();
    }

    render() {
        return (
            <Bar
            data={[{x:'2016-12-25', y:20}, {x:'2016-12-26', y:10}]}
            width={100}
            height={50}
            options={{
                maintainAspectRatio: false
            }}
            />
        )
    }
}
